e = this.value\'},\n    value: \'\',\n    getnext: true,\n    required: true,\n    prefix: \'prefix-\',\n    type: \'select\',\n    options: {\'\': \'no value\', 1: \'value-1\', n: \'value-n\'}\n  },\n  {\n    name: \'bar\',\n    attributes: {value: \'bar\', disabled: \'disabled\'},\n    value: \'bar bar\',\n    suffix: \'-suffix\'\n  },\n  \'baz\'\n];\nvar options = {};\noptions.title = \'Dialog title\';\noptions.stitle = \'Submit it!\';\noptions.validate = function(tag, form) {\n  return confirm(\'Confirm?\');\n};\noptions.submit = function(tag, form) {\n  var str = \'\\nForm elements name-value pairs\\n\';\n  $.each(form.elements, function(i, el){\n    str += el.name +\'=\'+ el.value +\'\\n\';\n  });\n  E.replaceSelection(str);\n};\n\nE.tagDialog(\'tag\', form, options);','Custom Form','D',0),(48,4,'Toggle tag','js: E.toggleTag(\'strong\', {\'class\': \'error\', style: \'font: courier\'});','Toggle tag','T',1),(49,4,'AjaxPreview','js: E.prvAjax();','XPreview','E',2),(50,4,'Find','js: E.frForm();','Find','F',3),(51,4,'Replace','js: E.frForm({\n  isrep: true, //enable replace\n  iscase: true, //enable case sensitive switch\n  isreg: true, //enable regular expression switch\n  title: \'Replace some text\' //custom title\n});','Replace','R',4),(52,4,'Undo','js: E.undo();','Undo','Z',5),(53,4,'Redo','js: E.redo();','Redo','Y',6),(54,4,'tpl:break','<br />','','',7),(55,4,'Test accessibility','js:\nvar $html = $(\'<p>Open this using Ctrl+J</p><p>Use UP, DOWN, ENTER, ESC</p><p><a href=\"#\" title=\"Option1\">Choose Option1</a></p><p><a href=\"#\" title=\"Option2\">Choose Option2</a></p><p><a href=\"#\" title=\"Option3\">Choose Option3</a></p>\');\n\n$html.find(\'a\').click(function(){\n  E.replaceSelection(this.title + \' was chosen\');\n  return false;\n});\n\nE.quickPop.open($html);','Choose','J',8),(56,4,'Direct IMCE','js: E.imce && E.imce.url && \nE.imce.open({\n  ready: E.imce.readyDefault,\n  sendto: function(file, win, pop) {\n    if (!file.width) return win.imce.setMessage(\'Please select an image file!\', \'error\');\n    pop.close();\n    E.replaceSelection(\'<img src=\"\'+ file.url +\'\" width=\"\'+ file.width +\'\" height=\"\'+ file.height +\'\" alt=\"\'+ file.name +\'\">\').focus();\n  }\n});','Image(IMCE)','M',9),(57,4,'Auto LI','<ul>\n  <li>Press enter to insert another list item</li>%TEXT%\n</ul>','Auto LI','L',10),(58,4,'Help','js: E.help();','???','H',11),(59,4,'tpl:Extend postprocesses','js:\nBUE.postprocess._lab1 = function(E, $) {\n  E.ACAdd(\'BUE\', \' rocks!\');/*add an autocomplete pair*/\n  E.history.period = 100;/*change state saving period of undo history from 500ms to 100ms*/\n};','','',12),(60,4,'tpl:Druplicon','js:\nsetTimeout(function(){$(\'#edit-demo-value\').val(\'This is the guinea pig editor including all libraries(minified version is %BUEDITOR/library/bue.min.all.js) that come with bueditor. \\nThis text was inserted here by a template button running javascript code.\\n\\nHere you can experience:\\n- CTRL shortcuts(try Ctrl+J when the cursor is in the textarea)\\n- TAB-indent, Shift+TAB-unindent, ENTER-auto indent\\n- Autocomplete (type \"BUE\" or an html/bbcode tag, e.g. \"<em>\")\\n- Cross-browser undo/redo\\n- CSS3 popups, shortcuts in popups\\n- Find & Replace inside the textarea\\n- Ajax preview\');});\n\nreturn \'<img src=\"\'+ Drupal.settings.basePath +\'misc/druplicon.png\" width=\"16\" height=\"16\" title=\"Me inserted the initial text\" alt=\"druplicon\" />\';','','',13);
