pipes during flow. Project was carried out in 2007ve that was designed to prevent deformation of pipes during flow. Project was carried out in 2007','',NULL),('node','group',0,21,35,'und',0,'How come I didn\'t have a single content on this group.  Ok, this is just a group to show how groups work','',NULL),('node','event',0,22,36,'und',0,'This is going to be a feature building sprint, we are trying to roll out the Event features for campuswiki. Knowledge of Drupal and Git are essential. Kindly signup if you intend to attend','','wiki'),('node','event',0,26,40,'und',0,'A meeting of all who have been to Ghana, let\'s come review all','','plain_text'),('node','wiki',0,29,45,'und',0,'I hope some text would do here, thanks.d','','wiki'),('node','wiki',0,30,46,'und',0,'Just to test the whole thing after mega config.  Hope this actually work. Just to test the whole thing after mega config.  Hope this actually work. Just to test the whole thing after mega config.  Hope this actually work. Just to test the whole thing after mega config.  Hope this actually work. Just to test the whole thing after mega config.  Hope this actually work. Just to test the whole thing after mega config.  Hope this actually work. Just to test the whole thing after mega config.  Hope this actually work. Just to test the whole thing after mega config.  Hope this actually work. Just to test the whole thing after mega config.  Hope this actually work. Just to test the whole thing after mega config.  Hope this actually work. Just to test the whole thing after mega config.  Hope this actually work. Just to test the whole thing after mega config.  Hope this actually work. Just to test the whole thing after mega config.  Hope this actually work. Just to test the whole thing after mega config.  Hope this actually work. Just to test the whole thing after mega config.  Hope this actually work. Just to test the whole thing after mega config.  Hope this actually work. Just to test the whole thing after mega config.  Hope this actually work. ','','wiki'),('node','group',0,31,47,'und',0,'Ya, you all should actually see this group.  This is king of nice, I would not add an image cos I need to use the default image.  Thanks to all, this is so cool.','',NULL),('node','event',0,32,48,'und',0,'This would be a great event to test the event counts for upcoming event, hope this sure works cos I would be so happy','','wiki'),('node','event',0,33,49,'und',0,'This is an event that was published after the event date, just to make sure it is a past event, I don\'t want anyone to show up','','wiki'),('node','event',0,34,50,'und',0,'I just hope you would all come, cos I need to know how may people would be coming','','wiki'),('node','event',0,37,53,'und',0,'This event is just to check if a a none signed in dude can attend an event, cos I really don\'t want this to happen, I would have to write custom code to ensure we can do this','','wiki'),('node','event',0,40,56,'und',0,'You can attend this event but don\'t RSVP','','wiki'),('node','group',0,42,58,'und',0,'This is just a group to see if I can post contents in a private group.  Just wondering why my other groups are not listed and why I face this issue.','',NULL),('node','wiki',0,43,72,'und',0,'Introduction\r\nComputer-Aided Design/Computer-Aided Manufacturing (CAD/CAM), the application of computers in the design and manufacture of components used in the production of items such as automobiles and jet engines. CAD is [[software]] for creating precise engineering drawingsMicrosoft Encarta 2009. CAM adds a computer to a machine tool, such as a drill or a lathe. CAM engineers similarly use computer modeling to determine the best overall manufacturing procedures for use in an industrial plant, including the testing and handling of finished products. Engineers use CAD and CAM together to create the design in CAD on one computer, then transmit the design to a second computer that creates the part using CAM.\r\n\r\nCOMPUTER-AIDED DESIGN\r\nEngineers use CAD to create two- and three-dimensional drawings, such as those for automobile and airplane parts, floor plans, and maps. While it may be faster for an engineer to create an initial drawing by hand, it is much more efficient to change and distribute drawings by computer. In the design stage, drafting and computer graphics techniques are combined to produce models of objects. Designers manipulate and test these models on video display screens until they incorporate the best balance of features, including ease of production and cost. The CAD information is then combined with CAM procedures through shared databases. Today, it is possible to perform the six-step \'art-to-part\' process with a computer. The first two steps in this process are the use of sketching software to capture the initial design ideas and to produce accurate engineering drawings. The third step is rendering an accurate image of what the part will look like. Next, engineers use analysis software to ensure that the part is strong enough. Step five is the production of a prototype, or model. In the final step the CAM software controls the machine that produces the part.\r\n\r\nCOMPUTER-AIDED MANUFACTURING\r\nCAM uses a computer to control the manufacture of objects such as parts, which are most often made of metal, plastic, or wood. The manufacturing operations may include milling, drilling, lathing, and polishing. CAM software selects the best cutting tools for the material and sets the most effective cutting speed. The software generates an image, called a toolpath display, that shows how the tool will cut the material, much as print preview in a word-processing program displays a page before it is printed. The tool\'s path has three stages: the containment area, beyond which the tool may not cut; the rough cut, which removes large areas of material; and the surface finish cut, which removes gouges, produces a smooth finish, and cleans up the part.\r\n\r\nHISTORY\r\nAmerican Ivan Sutherland invented CAD in 1961 when he described a computerized sketchpad in a doctoral thesis while attending the Massachusetts Institute of Technology (MIT) in Cambridge, Massachusetts. He designed CAD to replace the traditional drafting board and other tools drafters used, such as the ink pen, plastic stencil, and electric eraser. Early CAD software ran on large, expensive computers. Today, engineers can run CAD software on personal computers or [[UNIX]] workstations. The earliest CAM software was a simple computer attached to a milling machine. Punching buttons on the computer’s front panel programmed the software for the machine. Since the mid-1980s CAD and CAM have come closer together, as some CAM software operates within the CAD software programs instead of through shared databases.','','wiki'),('node','album',0,44,60,'und',0,'This is a test for all to see how the galley feature works within a group. I hope this would be nice so I can go on to some other feature. This should be nice','',NULL),('node','event',0,52,68,'und',0,'This is about the best departmental event. There would be plenty to eat and drink and what\'s more? We can discuss latest trends in Mechanical Engineering. I just know this would be great.  Mind you this event is upcoming and by January we would be done. Thanks for all who would attend.','','plain_text'),('node','event',0,54,70,'und',0,'As Mechanical Engineering students, we have to plan the year as the session begins; what events and activities would be on the table this year? This is the event to have it all planned; you may call it the mother of all events. Please come along with your tablets and smart phones.','','wiki');
