INSERT INTO `field_revision_field_about` VALUES ('user','user',0,1,1,'und',0,'Mechanical Engineer who loves IT.',NULL),('user','user',0,9,9,'und',0,'I am an advocate of dedicated business and technology institutions as I believe these are the two ingredients for a developed economy',NULL),('user','user',0,10,10,'und',0,'I am a pragmatic fellow with a simple vision of the world',NULL),('user','user',0,11,11,'und',0,'I have always been fascinated with languages and currently speak 7 international languages.',NULL),('user','user',0,12,12,'und',0,'I am studying Theatre Arts. I love fashion and trends. ',NULL),('user','user',0,13,13,'und',0,'I\'m a Theater arts student. I love assisting people and showing them how to carry on through entertainment.',NULL),('user','user',0,14,14,'und',0,'I am a student of Biochemistry. I love social networking especially meeting old friends. I want to be a great scientist someday.',NULL),('user','user',0,15,15,'und',0,'I am an Engineering Student and have a number of high profile projects on my portfolio. ',NULL),('user','user',0,16,16,'und',0,'My strength has always been in physical things. I love to get my hands dirty, doing the job. I am a network and systems administrator. Hardware is my field as I tend to avoid the abstracts.',NULL),('user','user',0,17,17,'und',0,'Charismatic ',NULL),('user','user',0,18,18,'und',0,'Student of Virtual Technology, I hope to go into enhance systems simulation when I graduate. Presently a huge fan of secondlife.com believing the next level in social network is in 3D',NULL),('user','user',0,19,19,'und',0,'I studied ancient history in Rome and have travelled almost all the ancient cities in the world. Currently in charge of seamless integration of various web projects, with a bid to creating a truly open web environment for everyone',NULL);
