 then transmit the design to a second computer that creates the part using cam computeraided design engineers use cad to create two and threedimensional drawings such as those for automobile and airplane parts floor plans and maps while it may be faster for an engineer to create an initial drawing by hand it is much more efficient to change and distribute drawings by computer in the design stage drafting and computer graphics techniques are combined to produce models of objects designers manipulate and test these models on video display screens until they incorporate the best balance of features including ease of production and cost the cad information is then combined with cam procedures through shared databases today it is possible to perform the sixstep arttopart process with a computer the first two steps in this process are the use of sketching software to capture the initial design ideas and to produce accurate engineering drawings the third step is rendering an accurate image of what the part will look like next engineers use analysis software to ensure that the part is strong enough step five is the production of a prototype or model in the final step the cam software controls the machine that produces the part computeraided manufacturing cam uses a computer to control the manufacture of objects such as parts which are most often made of metal plastic or wood the manufacturing operations may include milling drilling lathing and polishing cam software selects the best cutting tools for the material and sets the most effective cutting speed the software generates an image called a toolpath display that shows how the tool will cut the material much as print preview in a wordprocessing program displays a page before it is printed the tool s path has three stages the containment area beyond which the tool may not cut the rough cut which removes large areas of material and the surface finish cut which removes gouges produces a smooth finish and cleans up the part 